        .action-button {padding:12px 20px;text-align:center;text-decoration:none;color:white;border-radius:var(--border-radius-element);font-weight:bold;border:none;transition:var(--transition-standard);font-size:var(--font-small);min-width:140px;box-shadow:var(--box-shadow-standard);cursor:pointer}
        
        .action-button:hover {transform:translateY(-2px);box-shadow:var(--box-shadow-hover)}

            100% {transform:rotate(360deg)}}

        @keyframes fadeIn {from {opacity:0;transform:translateY(10px)}
